            document.getElementById("buttonDiv"),
            // @type{!GsiButtonConfiguration}
            { 
                type: 'standard',
                theme: "filled_blue", 
                size: "large", 
                text:'signup_with',
                width: '370',
                height: 100,
                logo_alignment: 'left'


            }  // customization attributes
        )
        // window.google.accounts.id.prompt(); // also display the One Tap dialog
    })

    return <div id="buttonDiv"></div>    

}

